import "./App.css";
import { Route } from "react-router";
import Play from "./components/Play";
import Home from "./components/Home";

function App() {
  return (
    <div className="App">
      <Home />
      <Route exact path="/play" component={Play}
      />
    </div>
  );
}

export default App;
